import React, { Component } from 'react';

const Gallery = (props) => {
	const images = props.images;
	const imageRef = props.imageRef;

	let image = () => {
		images.find((image) => {
			if (image.id == imageRef) return true;
		});
	};
	console.log(image);

	return (
		<>
			<div>{imageRef}</div>
			<div onClick={props.onClick}>exit</div>
		</>
	);
};

export default Gallery;
